import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import Header from "../../components/Header";
import axios from "axios";

class Welcome extends Component {
  displayUser = () => {
    const baseurl = "http://localhost:8080/api/userinfo";

    console.log("here");
    axios.post(baseurl, { withCredentials: true }).then((response) => {
      console.log(response.result.data.content.username);
      console.log("um ok");
    });
  };

  render() {
    return (
      <React.Fragment>
        <Header />
        <Button onClick={this.displayUser}> Set Name</Button>
        <Button> get Name</Button>
        <Button> del Name</Button>
      </React.Fragment>
    );
  }
}

export default Welcome;
